    <p>
      &#1054;&#1087;&#1088;&#1077;&#1076;&#1077;&#1083;&#1103;&#1077;&#1090;&#1089;&#1103; &#1082;&#1086;&#1083;&#1080;&#1095;&#1077;&#1089;&#1090;&#1074;&#1086; &#1074;&#1089;&#1077;&#1093; &#1076;&#1086;&#1082;&#1091;&#1084;&#1077;&#1085;&#1090;&#1086;&#1074; &#1087;&#1086; &#1074;&#1089;&#1077;&#1084; &#1089;&#1072;&#1081;&#1090;&#1072;&#1084; &#1074; &#1074;&#1099;&#1076;&#1072;&#1095;&#1077; &#1087;&#1086; &#1101;&#1090;&#1086;&#1084;&#1091; &#1087;&#1086; &#1101;&#1090;&#1086;&#1084;&#1091; &#1079;&#1072;&#1087;&#1088;&#1086;&#1089;&#1091;
    </p>
    <p>
      &#1054;&#1087;&#1088;&#1077;&#1076;&#1077;&#1083;&#1103;&#1077;&#1090;&#1089;&#1103; &#1082;&#1086;&#1083;&#1080;&#1095;&#1077;&#1089;&#1090;&#1074;&#1086; &#1074;&#1086;&#1086;&#1073;&#1097;&#1077; &#1074;&#1089;&#1077;&#1093; &#1076;&#1086;&#1082;&#1091;&#1084;&#1077;&#1085;&#1090;&#1086;&#1074; &#1087;&#1086; &#1074;&#1089;&#1077;&#1084; &#1089;&#1072;&#1081;&#1090;&#1072;&#1084; &#1074; &#1074;&#1099;&#1076;&#1072;&#1095;&#1077;
    </p>
    <p>
      
    </p>
    <p>
      <font color="rgb(34, 34, 34)" face="sans-serif">&#1045;&#1089;&#1083;&#1080; &#1076;&#1086;&#1082;&#1091;&#1084;&#1077;&#1085;&#1090; &#1089;&#1086;&#1076;&#1077;&#1088;&#1078;&#1080;&#1090; 100 &#1089;&#1083;&#1086;&#1074; &#1080; &#1089;&#1083;&#1086;&#1074;&#1086;</font><font color="rgb(11, 0, 128)" face="sans-serif" size="11.2px"><sup id="cite_ref-3" class="reference" style="line-height: 1em; white-space: nowrap; font-size: 11.2px; color: rgb(34, 34, 34); font-family: sans-serif; font-style: normal; font-weight: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; word-spacing: 0px; background-color: rgb(255, 255, 255)"><a href="https://ru.wikipedia.org/wiki/TF-IDF#cite_note-3" style="text-decoration: none; color: rgb(11, 0, 128); background-image: null; background-repeat: repeat; background-attachment: scroll; background-position: null">[3]</a></sup></font><font color="rgb(34, 34, 34)" face="sans-serif">&#160;&#171;&#1079;&#1072;&#1103;&#1094;&#187; &#1074;&#1089;&#1090;&#1088;&#1077;&#1095;&#1072;&#1077;&#1090;&#1089;&#1103; &#1074; &#1085;&#1105;&#1084; 3 &#1088;&#1072;&#1079;&#1072;, &#1090;&#1086; &#1095;&#1072;&#1089;&#1090;&#1086;&#1090;&#1072; &#1089;&#1083;&#1086;&#1074;&#1072; (TF) &#1076;&#1083;&#1103; &#1089;&#1083;&#1086;&#1074;&#1072; &#171;&#1079;&#1072;&#1103;&#1094;&#187; &#1074; &#1076;&#1086;&#1082;&#1091;&#1084;&#1077;&#1085;&#1090;&#1077; &#1073;&#1091;&#1076;&#1077;&#1090; 0,03 (3/100). &#1042;&#1099;&#1095;&#1080;&#1089;&#1083;&#1080;&#1084; IDF &#1082;&#1072;&#1082; &#1076;&#1077;&#1089;&#1103;&#1090;&#1080;&#1095;&#1085;&#1099;&#1081; &#1083;&#1086;&#1075;&#1072;&#1088;&#1080;&#1092;&#1084; &#1086;&#1090;&#1085;&#1086;&#1096;&#1077;&#1085;&#1080;&#1103; &#1082;&#1086;&#1083;&#1080;&#1095;&#1077;&#1089;&#1090;&#1074;&#1072; &#1074;&#1089;&#1077;&#1093; &#1076;&#1086;&#1082;&#1091;&#1084;&#1077;&#1085;&#1090;&#1086;&#1074; &#1082; &#1082;&#1086;&#1083;&#1080;&#1095;&#1077;&#1089;&#1090;&#1074;&#1091; &#1076;&#1086;&#1082;&#1091;&#1084;&#1077;&#1085;&#1090;&#1086;&#1074; &#1089;&#1086;&#1076;&#1077;&#1088;&#1078;&#1072;&#1097;&#1080;&#1093; &#1089;&#1083;&#1086;&#1074;&#1086; &#171;&#1079;&#1072;&#1103;&#1094;&#187;. &#1058;&#1072;&#1082;&#1080;&#1084; &#1086;&#1073;&#1088;&#1072;&#1079;&#1086;&#1084;, &#1077;&#1089;&#1083;&#1080; &#171;&#1079;&#1072;&#1103;&#1094;&#187; &#1089;&#1086;&#1076;&#1077;&#1088;&#1078;&#1080;&#1090;&#1089;&#1103; &#1074; 1000 &#1076;&#1086;&#1082;&#1091;&#1084;&#1077;&#1085;&#1090;&#1086;&#1074; &#1080;&#1079; 10&#160;000&#160;000 &#1076;&#1086;&#1082;&#1091;&#1084;&#1077;&#1085;&#1090;&#1086;&#1074;, &#1090;&#1086; IDF &#1073;&#1091;&#1076;&#1077;&#1090; &#1088;&#1072;&#1074;&#1085;&#1086;&#1081;: log(10 000 000/1000) = 4. &#1044;&#1083;&#1103; &#1088;&#1072;&#1089;&#1095;&#1077;&#1090;&#1072; &#1086;&#1082;&#1086;&#1085;&#1095;&#1072;&#1090;&#1077;&#1083;&#1100;&#1085;&#1086;&#1075;&#1086; &#1079;&#1085;&#1072;&#1095;&#1077;&#1085;&#1080;&#1103; &#1074;&#1077;&#1089;&#1072; &#1089;&#1083;&#1086;&#1074;&#1072; &#1085;&#1077;&#1086;&#1073;&#1093;&#1086;&#1076;&#1080;&#1084;&#1086; TF &#1091;&#1084;&#1085;&#1086;&#1078;&#1080;&#1090;&#1100; &#1085;&#1072; IDF. &#1042; &#1076;&#1072;&#1085;&#1085;&#1086;&#1084; &#1087;&#1088;&#1080;&#1084;&#1077;&#1088;&#1077;, TF-IDF &#1074;&#1077;&#1089; &#1076;&#1083;&#1103; &#1089;&#1083;&#1086;&#1074;&#1072; &#171;&#1079;&#1072;&#1103;&#1094;&#187; &#1074; &#1074;&#1099;&#1073;&#1088;&#1072;&#1085;&#1085;&#1086;&#1084; &#1076;&#1086;&#1082;&#1091;&#1084;&#1077;&#1085;&#1090;&#1077; &#1073;&#1091;&#1076;&#1077;&#1090; &#1088;&#1072;&#1074;&#1077;&#1085;: 0,03 &#215; 4 = 0,12.</font>
    </p>
    <p>
      
    </p>
    <p>
      &#1055;&#1086;&#1080;&#1089;&#1082;&#1086;&#1074;&#1080;&#1082; &#1086;&#1087;&#1088;&#1077;&#1076;&#1077;&#1083;&#1103;&#1077;&#1090; &#1077;&#1089;&#1090;&#1077;&#1089;&#1090;&#1074;&#1077;&#1085;&#1085;&#1086; &#1088;&#1077;&#1083;&#1077;&#1074;&#1072;&#1085;&#1090;&#1085;&#1086;&#1089;&#1090;&#1080;. &#1054;&#1085; &#1089;&#1088;&#1072;&#1074;&#1085;&#1080;&#1074;&#1072;&#1077;&#1090; &#1085;&#1072;&#1096;&#1091; &#1089;&#1090;&#1088;&#1072;&#1085;&#1080;&#1095;&#1082;&#1091; &#1089; &#1076;&#1088;&#1091;&#1075;&#1080;&#1084;&#1080; &#1089;&#1090;&#1088;&#1072;&#1085;&#1080;&#1095;&#1082;&#1072;&#1084;&#1080; &#1074; &#1080;&#1085;&#1076;&#1077;&#1082;&#1089;&#1077;.
